					{{#if background.dropShadow}}
					</g>
					{{/if}}
			    {{#if pictureTransform}}
				</g>
				{{/if}}
			</g>
		{{/if}}

		{{{background.bottom}}}

		{{#if background.gloss.enabled}}
			<use xlink:href="#gloss-{{background.gloss.position}}" opacity="{{background.gloss.opacity}}" />
		{{/if}}

{{else}}

		{{#if picture}}

		    {{#if picture.gradient}}
		        <defs>
		            {{{picture.gradient}}}
		        </defs>
		    {{/if}}

            {{#if pictureTransform}}
            <g transform="
                    translate(50 50)
                    translate({{picture.translateX}} {{picture.translateY}}) {{#if picture.rotate}}rotate({{picture.rotate}}){{/if}} {{#if picture.scale}}scale({{picture.scale}}){{/if}} {{#if picture.flipX}}scale(-1 1){{/if}} {{#if picture.flipY}}scale(1 -1){{/if}}
                    translate(-50 -50)
                    ">
            {{/if}}

            {{#if picture.gradient}}
            <g fill="url(#picture-gradient)">
            {{/if}}

                {{{picture.defs}}}

            {{#if picture.gradient}}
            </g>
            {{/if}}

            {{#if pictureTransform}}
            </g>
            {{/if}}
		{{/if}}

{{/if}}

	</svg>
</script>
<script id="template-gradient" type="text/x-handlebars">
	<linearGradient {{#if id}}id="{{id}}"{{/if}} x1="0" y1="0" y2="1" x2="0" {{#if rotate}}gradientTransform="rotate({{rotate}} 0.5 0.5)"{{/if}}>
		<stop stop-color="{{color1}}" offset="{{position1}}%"/>
		<stop stop-color="{{color2}}" offset="{{position2}}%"/>
	</linearGradient>
</script>
<script id="template-drop-shadow" type="text/x-handlebars">
	<filter id="drop-shadow">
		<feGaussianBlur in="SourceAlpha" stdDeviation="{{blur}}" />
		<feComponentTransfer>
			<feFuncA type="linear" slope="{{opacity}}"/>
		</feComponentTransfer>
		<feOffset dx="{{x}}" dy="{{y}}" result="offsetblur" />
		<feFlood flood-color="{{color}}" />
		<feComposite in2="offsetblur" operator="in" />
		<feMerge>
			<feMergeNode />
			<feMergeNode in="SourceGraphic" />
		</feMerge>
	</filter>
</script>
<!-- http://www.xanthir.com/b4Yv0 -->
<script id="template-inner-shadow" type="text/x-handlebars">
	<filter id="inner-shadow" x="-50%" y="-50%" width="200%" height="200%">
		<feComponentTransfer in="SourceAlpha">
			<feFuncA type="table" tableValues="1 0" />
		</feComponentTransfer>
		<feComponentTransfer>
			<feFuncA type="linear" slope="{{opacity}}"/>
		</feComponentTransfer>
		<feGaussianBlur stdDeviation="{{blur}}" />
		<feOffset dx="{{x}}" dy="{{y}}" result="offsetblur" />
		<feFlood flood-color="{{color}}" result="color" />
		<feComposite in2="offsetblur" operator="in" />
		<feComposite in2="SourceAlpha" operator="in" />
		<feMerge>
			<feMergeNode in="SourceGraphic" />
			<feMergeNode />
		</feMerge>
	</filter>
</script>

<script type="text/javascript">

    var Config = Config || {};

    Config.initialize = function () {

        var Session = this.Model.Session,
            upload = this.onUpload,
            limitIcon = 5,
            limitUpload = null; // 0;

        function uploaded(icon)
        {
            return icon && icon.picture && icon.picture.uploaded;
        }

        function LimitedSession(override)
        {
            var noticeUploadLimit = null,
                noticeIconLimit = null,
                icons = [],
                uploads = 0;

            // Limit number of uploaded icons
            if (limitUpload === null) {
                icons = (override || {}).icons || [];
            }
            else {
                _.each((override || {}).icons || [], function (icon) {
                    if (uploaded(icon)) {
                        if (uploads++ < limitUpload) {
                            icons.push(icon);
                        }
                    }
                    else {
                        icons.push(icon);
                    }
                });
                if (uploads > limitUpload) {
                    noticeUploadLimit = "You have reached maximum number of uploaded icons for your current subscription plan.";
                }
            }

            // Limit total number of icons
            if (limitIcon !== null) {
                if (icons.length > limitIcon) {
                    noticeIconLimit = "You have reached maximum number of icons for your current subscription plan.";
                }
                icons = icons.slice(-limitIcon);
            }

            if (noticeUploadLimit || noticeIconLimit) {
                Config.alert(React.createElement('div', null,
                    React.createElement('p', null, noticeUploadLimit),
                    React.createElement('p', null, noticeIconLimit),
                    React.createElement('p', null, "Please ",
                        React.createElement('a', {href: "\/pricing", target: '_blank'}, "upgrade"),
                        " your subscription plan"                        )
                    )
                );
            }

            Session.call(this, _.extend({}, override || {}, {icons: icons}));
        }

        LimitedSession.prototype = Object.create(Session.prototype, {
                constructor: {
                    value: LimitedSession,
                    enumerable: false,
                    writable: true,
                    configurable: true
                }
            }
        );

        function limitedUpload()
        {
            var uploads = 0,
                modal;

            _.each(Config.app.state.session.icons, function (icon) {
                if (!icon.origin) {
                    ++uploads;
                }
            });
